@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<div class="container">
  <h1>Welcome to the Home Page</h1>
  <p>This is the home page of the Employee Management System.</p>
  <a routerLink="/brands" class="btn btn-primary">Go to Brands</a>
</div>
